webpackJsonp([0xac80f62ef9f1],{452:function(n,e){n.exports={data:{site:{siteMetadata:{title:"DeepCold Blog",author:"DeepCold"}},markdownRemark:{id:"/Users/80253170/iserver/deepcoldy.github.io/src/pages/older/2015-09-17.md absPath of file >>> MarkdownRemark",html:'<h2>开始Angular Js的学习</h2>\n<p>首先要理解angular是一种mvc模式的js框架库，MVC即 Module-View-Controller的简称。</p>\n<p>Model是模块的意思，也就是说它用来存放各种组件。</p>\n<p>View是负责视觉，也就是用来存放各种HTML\\CSS。</p>\n<p>Controller是用来存放数据的，在angular中比如jason类型的数据就要存放在这里。</p>\n<p>{{xx}}这样样表达式能展示xx的值</p>\n<p>{{xx | yy}} yy是过滤器能规范xx的格式</p>\n<p>英文原文如下</p>\n<blockquote>\n<ul>\n<li>A <strong>module</strong> contains the different components of an AngularJS ap</li>\n</ul>\n</blockquote>\n<blockquote>\n<ul>\n<li>A <strong>controller</strong> manages the app’s dat</li>\n</ul>\n</blockquote>\n<blockquote>\n<ul>\n<li>An <strong>expression</strong> displays values on the pag</li>\n</ul>\n</blockquote>\n<blockquote>\n<ul>\n<li>A <strong>filter</strong> formats the value of an expression</li>\n</ul>\n</blockquote>\n<hr>\n<p>9.22续</p>\n<p>我已经弄明白angular的思想了。</p>\n<p>这是传说中得神贴</p>\n<p><a href="http://stackoverflow.com/questions/14994391/thinking-in-angularjs-if-i-have-a-jquery-background">http://stackoverflow.com/questions/14994391/thinking-in-angularjs-if-i-have-a-jquery-background</a></p>\n<p>主要就是说用angular的时候尽量不要同时使用jQuery</p>',frontmatter:{title:"Angular Js（第一章）",date:"September 17, 2015"}}},pathContext:{slug:"/older/2015-09-17/",previous:{fields:{slug:"/older/2015-09-15/"},frontmatter:{title:"css中em px"}},next:{fields:{slug:"/older/2015-09-22/"},frontmatter:{title:"随意写了个登陆窗口"}}}}}});
